import React from "react";
import ReactDOM from "react-dom";

var Fun=()=>{
   var x ,y;
    x=10,y=19;
    return(
   <h1>{x+y}</h1>
    )}


ReactDOM.render(
   <>
    
   <Fun/>
    </>
 ,document.getElementById("root"));
